ADOBE PHOTOSHOP CS5 TRAINING MANUAL FOR WINDOWS &amp; MAC

Photoshop CS5 Digital Classroom.

A complete Photoshop training package with book and DVD

Photoshop is the worlds most popular image-editing software with more than four million users worldwide. This full colour book and DVD work together to create an entire Photoshop training class that photographers, Web designers, and graphic designers can complete at their own pace. Thirteen lessons cover the features and capabilities of the newest version of Photoshop while teaching all the essential skills.

Photoshop is the image-editing software preferred by professional photographers and designers around the world; the latest version includes new functionality and enhanced tools

Photoshop Digital Classroom allows you to learn Photoshop from the experts who create official Adobe training materials, and do it at your own speed.

